    const convertedData = originalData.map(item => {
      const [day, month, year] = item.Date.split('/');
      const [hours, minutes] = item.Time.split(':');
      return {
        x: new Date(parseInt(year), parseInt(month) - 1, parseInt(day), parseInt(hours), parseInt(minutes)),
        y: parseFloat(item['Glucose mmol/L']),
        classification: item.Classification
      };
    });

    // Add an additional data point for demonstration purposes
    convertedData.push({
      x: new Date(2023, 7, 1, 2, 14),
      y: 20.4,
      classification: "Dawn Phenomenon"
    });

    const formattedData = convertedData.map(item => {
      return {
        x: `new Date(${item.x.getFullYear()}, ${item.x.getMonth()}, ${item.x.getDate()}, ${item.x.getHours()}, ${item.x.getMinutes()})`,
        y: item.y,
        classification: item.classification
      };
    });

    const dataElement = document.getElementById('convertedData');
    dataElement.textContent = JSON.stringify(formattedData, null, 2);

    const saveButton = document.getElementById('saveButton');
    saveButton.addEventListener('click', saveJsonData);

    function saveJsonData() {
      const jsonData = JSON.stringify(formattedData, null, 2);
      const blob = new Blob([jsonData], { type: 'application/json' });
      const url = URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.download = 'converted_data.json';
      link.click();
      URL.revokeObjectURL(url);
    }
  </script>
